        <div className="shadow-2xl h-[500px] hover:scale-75 duration-100 ">
          First
        </div>
        <div className="shadow-2xl h-[500px] bg-gray-100 duration-100">
          Second
        </div>
        <div className="shadow-2xl h-[500px] hoce duration-100 ">Third</div>
      </div>
    </div>
  );
}
